package SimpleCode;

public class Program4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int marks =80;
		if(marks >92)
		{
			System.out.println("Grade A+");
			
		}
		else if(marks>80)
		{
			System.out.println("Grade A");
		}
		else if(marks >60)
		{
			System.out.println("Grade B");
		}
		else
		{
			System.out.println("Fail");
		}
	}
	

}
